import React from 'react';
import { FaStar } from 'react-icons/fa';
function Stars() {
  const Star = ({ selected = false }) => (
    <FaStar color={selected ? 'red' : 'grey'} />
  );
  return [
    <FaStar color="red" />,
    <FaStar color="red" />,
    <FaStar color="red" />,
    <FaStar color="grey" />,
    <FaStar color="grey" />,
  ];
}

export default Stars;
